import Layout from "./components/layout";
import Profile from "./components/profile";

function App() {
  return (
    <main>
      <Layout>
        <Profiles/>
        <div>Repositories</div>
        <div>Starreds</div>
      </Layout>
    </main>
  );
}

export default App;
